und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",ayc='Dimension',Wjc='Dimension [height=',quc='DirectionalTextHelper',tuc='DockLayoutPanel',uuc='DockLayoutPanel$Direction',vuc='DockLayoutPanel$Direction;',yuc='DockLayoutPanel$DockAnimateCommand',wuc='DockLayoutPanel$LayoutData',Aqc='DomEvent',Fqc='DomEvent$Type',Kwc='Double',Ygc='EAST',Gbc='EEE, d MMM yyyy HH:mm:ss Z',Lmc='EEE. dd MMM. yyyy HH:mm:ss',Gcc='EEEE MMMM d',fdc='EEEE, MMMM d',bdc='EEEE, MMMM d, y',Ccc='EEEE, y MMMM dd',h9b='EM',afc='EMPTY',ffc='ENABLED',zdc='END',j9b='EX',Wsc='ElementMapperImpl',Xsc='ElementMapperImpl$FreeNode',adc='English',Mpc='Enum',Tcc='Etc/GMT',Vcc='Etc/GMT+',Ucc='Etc/GMT-',C9b='Event type',Qvc='Event$NativePreviewEvent',Sqc='EventBus',Zoc='EventObject',cpc='Exception',Dfc='Expecting version 6 from server, got ',xac='F',Ukc='F8834F07517EF3B7D02B9E845E5E1B88',c9b='FIXED',_fc='FLOAT',Ckc='Fail: ',Rac='Feb',Fac='February',Lwc='Float',zuc='FlowPanel',Ptc='FocusImpl',Rtc='FocusImplSafari',Qtc='FocusImplStandard',$tc='FocusWidget',Zic='For i
